atividades1:
Atuando como Professora da Turma de Mini Grupo I;
• Organização de planejamentos semanais, alinhados as documentações pedagógicas, promovendo
experiências significativas e respeitando os interesses e a curiosidade das crianças;
• Criação de relatórios individuais, portfolios individuais e coletivos com registros detalhados sobre as
vivências das crianças, incluindo registro fotográfico, desenhos e relatos;
• Criação de projetos pedagógicos significativos, como explorações sensoriais com argila, interações com
a natureza e vivências que promovem a expressão criativa.
• Preparação de espaços educativos que estimulam a autonomia, criatividade e a exploração, com
materiais acessíveis e intencionais;
• Organização de Diário de Bordo e Diário de Classe;
• Documentação pedagógica como, Percurso da turma, Carta de Intenção e Carta Pedagógica.

